import './styling/App.css';
import logo from './assets/swipeLogo.png';
import CustomersTable from './components/CustomersTable';
import InvoiceTable from './components/InvoiceTable';
import ProductTable from './components/ProductTable';
import { useState } from 'react';

function App() {

  const [selectedTab, setSelectedTab] = useState('About');

  const renderTabContent = () => {
    switch (selectedTab) {
      case 'Customers':
        return <CustomersTable />;
      case 'Invoices':
        return <InvoiceTable />;
      case 'Products':
        return <ProductTable />;
      case 'About':
        return <div>About us content</div>;
      default:
        return <div>Welcome to the App</div>;
    }
  };

  return (
    <div className="App">
      <header className='header'>
        <img className='header-image' src={logo} alt='Logo' />

        <nav className='nav-menu'>
          <button className={`nav-button ${selectedTab === 'Customers' ? 'active' : ''}`} onClick={() => setSelectedTab('Customers')}>
            Customers
          </button>
          <button className={`nav-button ${selectedTab === 'Invoices' ? 'active' : ''}`} onClick={() => setSelectedTab('Invoices')}>
            Invoices
          </button>
          <button className={`nav-button ${selectedTab === 'Products' ? 'active' : ''}`} onClick={() => setSelectedTab('Products')}>
            Products
          </button>
          <button className={`nav-button ${selectedTab === 'About' ? 'active' : ''}`} onClick={() => setSelectedTab('About')}>
            About
          </button>
        </nav>
      </header>
      <div className='content'>
        {renderTabContent()}
      </div>
    </div>
  );
}

export default App;
